import React from 'react'

function Home(){
    const login = () => window.location.href = 'http://localhost:5000/api/user/login'
    return (
      <div>
        <img src={process.env.PUBLIC_URL + '/img/titre.png'} />
        <button className='button-login' onClick = {login}>Login
        <img src={process.env.PUBLIC_URL + '/img/discord.png'} /></button>
      </div>
    )
  }

export default Home;
